INSERT INTO `layout` VALUES (1,'1560793734.jpg','CHLINK','Chatham County Children and Adolescent Behavioral Health Services Directory (Ages 0-17)','<p style=\"text-align: left; margin-left: 25px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"CCSNPC logo low res.jpg\" style=\"width: 208.674px; float: left; height: 112px;\"></p><p style=\"text-align: left; margin-left: 25px;\"><br></p><p style=\"text-align: left; margin-left: 25px;\"><br></p><p style=\"text-align: left; margin-left: 25px;\"><br></p><blockquote style=\"color: rgb(34, 34, 34); font-size: small;\"><br>G<a href=\"https://www.georgiacollaborative.com/providers/georgia-crisis-and-access-line-gcal/\" target=\"_blank\" style=\"font-size: small; background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;\">eorgia Access and Crisis Line (GCAL) </a><font face=\"Arial, Helvetica, sans-serif\" style=\"color: rgb(34, 34, 34); font-size: small;\">-&nbsp;</font><span style=\"font-size: small;\"><font face=\"Arial Black\" style=\"\"><font color=\"#545454\">1-800-715-4225<br></font></font></span><a href=\"https://www.crisistextline.org/\" target=\"_blank\" style=\"font-size: small; background-color: rgb(255, 255, 255); font-family: Arial, Helvetica, sans-serif;\">Crisis Text Line for Youth</a><font face=\"Arial, Helvetica, sans-serif\" style=\"color: rgb(34, 34, 34); font-size: small;\">&nbsp; - </font><font face=\"Arial Black\" style=\"color: rgb(34, 34, 34); font-size: small;\">Text \"HOME\" to 74174 </font><span style=\"color: rgb(34, 34, 34); font-size: small; font-family: Arial, Helvetica, sans-serif;\">(24/7 Crisis Support)<br><br></span><span style=\"font-family: Arial, Helvetica, sans-serif;\"><a href=\"https://www.thetrevorproject.org/\" target=\"_blank\">Trevor Project</a> - </span><font face=\"Arial Black\">1-866-488-7386</font><font face=\"Arial, Helvetica, sans-serif\"> (Crisis and Suicide Prevention Support line for LGBTQ)<br></font><span style=\"font-family: Arial, Helvetica, sans-serif;\"><a href=\"https://www.glbthotline.org/\" target=\"_blank\">LGBT Youth Talkline</a> </span><font face=\"Arial Black\">1-800-246-7743<br></font><br><span style=\"font-family: Arial, Helvetica, sans-serif;\"><a href=\"https://www.georgiapoisoncenter.org/\" target=\"_blank\">Poison Control Hotline</a> - </span><font face=\"Arial Black\">1-800-222-1222<br></font><font face=\"Arial Black\"><br></font><font face=\"Arial Black\">For all Emergencies, please call 9-1-1</font></blockquote><p style=\"text-align: left;\"></p>','Site maintained by Chatham County Safety Net Planning Council','Contact Us','https://chathamsafetynet.org/','<p style=\"text-align: center; \">This website is made possible through a grant from the Department of Behavioral Health Office of Children Youth and Families</p>','Chatham County Children and Adolescent Behavioral Health Services Directory','Site maintained by Chatham County Safety Net Planning Council, www.chathamsafetynet.org.','Directory updated and maintained by Chatham County Safety Net Planning Council. chathamsafetynet.org','0','#012169','#abcae9','#418fde','#0467f5');
