INSERT INTO `organizations` VALUES (1,599571630068226,'Georgia Outreach LLC',NULL,'https://dl.airtable.com/.attachments/aae224a02fcec7c674a1c70d60c055fc/a9e0df49/georgiaoutreachlogo.png',NULL,'Georgia Outreach provides outpatient mental health professional services including medication management. They are a team of psychiatrists, licensed individual and family psychotherapists and professional counselors.  General services offered include; Psychiatry Services, Counseling and Pyschotherapy Services, Military members and Family Services, Anger Management Class, Professional Supervision \n\nEach provider brings their own unique way to providing care backed with years of training and experience.  Regardless of their professional back ground, each is committed to providing the care and treatment needed to get through any situation. \n','admin@georgiaoutreach.com',NULL,NULL,'https://www.georgiaoutreach.com/','Not vetted',3,NULL,NULL,NULL,NULL,'770511197625917,582785583063538,789259872814930','1223764135647595','982008775481883',843893991634406,'639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,616815450655447,618650255730163,1207857486716732,573698134502315,890080428886480,12472204215','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400-1400.8000-100 Bereavement Counseling,RP-5000.5000-050 Anxiety Disorder Screening,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,RF-2000 Family Counseling,PH-6100.6800 Parenting Skills Classes',NULL),(2,549646291248758,'Horizon Behavioral Health',NULL,'https://dl.airtable.com/.attachments/584f2b90e3d1886ca5a58852521ef44b/9a35b0fe/hopecounselinglogo.jpg',NULL,'Established in 2011, Horizon Behavioral Health (HBH) is a private multidisciplinary practice providing psychiatric, psychological and therapy services. HBH has grown exponentially over the past five years and has three offices: Hinesville, GA, Savannah, GA and Rincon, GA. With over thirteen providers and twenty administrative staff members, we approach each patient with a team effort of highly skilled professionals.\n\nOur patients are the cornerstone of our practice and we do our best to ensure an exceptional experience from beginning to end. From initial intake to navigating insurance, HBH believes in supporting our patients so that they never feel alone on their treatment journey. With an average of 3000 appointments available per month, we are sufficiently staffed so that our new patients can secure an appointment within a short time frame.\n\nDue to our proximity to Fort Stewart and Hunter Army Airfield, a large portion of our patients are active or retired military and their families. *We accept TRICARE and are a proud provider of the Veterans Choice Program. We are honored to be able to play a role in helping to maintain the mental health of the local military community. With many of our staff members being military spouses or veterans themselves, we have a unique perspective on the challenges of military life.\n\nContact our office at (912) 785-2100 to find out more about our services and how we can help to provide you with a comprehensive treatment plan.\n\n*Spouses and Dependents of Active Duty Military, as well as Retirees and their Dependents,  may self-refer to Horizon Behavioral Health. Our staff will happily obtain all the necessary TRICARE authorizations for you.','lauren.francis@hbhca.com',NULL,NULL,'https://www.hbhga.com/',NULL,4,NULL,NULL,NULL,NULL,'614002923690309,760623540846201,1214565746263480,1075264516958556','900571976097059','892746397861706,974922887595345,1010034677574566',1170898698427115,'639387097779678,1164281363890417,1213394553614190,767948698346501','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(3,567977363172359,'Introspection and Reflection',NULL,'https://dl.airtable.com/.attachments/ca17d97c76698faee591e48beb26f3a5/a99e3474/Introspectionreflection.png',NULL,'Community/Behavioral Health. Introspection & Reflection (INTROSPECTION & REFLECTION) is a behavioral health agency in Pooler, Georgia. Behavioral health centers are responsible for assuring the delivery of community based mental health, mental retardation, substance abuse and/or behavioral health services to individuals with those disabilities.','daysha@intospectionandreflection.com',NULL,NULL,'https://npino.com/behavioral-health/1467990119-introspection-&-reflection/','Not vetted',3,NULL,NULL,NULL,NULL,'1105393906140421,647403488137969','785541576275303,1281752689541066','958018420884621',1263119709592773,'639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,1321861983203612,953369181551142,616815450655447,618650255730163,890080428886480,1213394553614190,7420884041551','PH-6200.8300 Social Skills Training,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-070 Anger Management,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(4,600407365797872,'Youth to Adult','Gateway Youth to Adult','https://dl.airtable.com/.attachments/bc40ac8c4b06ae70d3f64005292322e1/9d0d9609/0.jpg',NULL,'Youth to Adult is a grant funded program for young adults between the ages of 16-26 in Chatham County with a mental health and/or substance abuse diagnosis.  The goal is to increase the ability of the youth in reaching their mental wellness goals through connection to services, pro-social activities, mentoring, advocacy, trainings, or the purchasing of goods.','Jessica.Matthewson@Gatewaybhs.org','Gateway Youth to Adult Referral Form.docx (1).doc','https://dl.airtable.com/.attachments/2514b3d08c768e8fc3e7b1d5bb9f2853/38b36dc9/GatewayYouthtoAdultReferralForm.docx1.doc','gatewaybhs.org','Vetted',1,NULL,NULL,NULL,NULL,'1011898937693085,1173312953284982,604312751782605,838003184119997','922278812748597','1226130516229368',1234406032412710,'639387097779678,915499537874128,953369181551142,1213394553614190,1242514362876733,1022757596728517,1091081542574390,639184920602996,748116754740747,1118923838832231,593506918155739,1259904023','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,PH-2400.1300 Case/Care Management Referrals',NULL),(5,628015162783225,'Nelson\'s Counseling and Wellness',NULL,'https://dl.airtable.com/.attachments/b77412e9b084dfbfaa973f17f2d3ff4b/a1d73c80/nelson-family-counseling-primary-logo.png',NULL,'Offering individual, family, couples and group therapy. Other services include Anger Management, Pre-marital counseling and Grief therapy. CBT and DBT','Nelsoncounseling@gmail.com',NULL,NULL,'https://www.facebook.com/pages/category/Medical---Health/Nelsons-Counseling-and-Wellness-518700551849277/',NULL,4,NULL,NULL,NULL,NULL,'926720105305464','979635528465297','939639665379994',867414241818820,'639387097779678,1213394553614190','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(6,632601911540717,'Care More Counseling Center',NULL,NULL,NULL,'Our office provides quality in home/community based services to children, teenagers, adults, and families that are identified as high risk, transitioning back into their homes, schools, and communities. Many of these families need crisis interventions and other supportive services. The program is is home, office, school, and community based, and consists of family assessments, individual and family counseling, group therapy, life skills, parenting, CSI, mentoring, and collaboration. ','admin@caremorecounselingcenterllc.com','CareMore Counseling.pdf','https://dl.airtable.com/.attachments/93990731f5e6bbafbeebac71f9591eec/04c5f7be/CareMoreCounseling.pdf','https://www.caremorecounselingcenterllc.com/','Not vetted',3,NULL,NULL,NULL,NULL,'942895839616355,1112885833072225,759377048072142,1263227006265507','1297069045710206,671073581987109','843145525137269',1011259399922196,'639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,618650255730163,675333962875133,616815450655447,953369181551142,1213394553614190,1242514362876733,109108154257',NULL,NULL),(7,675608168817870,'Viewpoint Care Management Entity',NULL,'https://dl.airtable.com/.attachments/20ce0088f5ee37ef7a1b8e5afe3fbb82/2aa7a3e3/viewpointlogo.png',NULL,'High Fidelity Wraparound/Intensive Customized Care Coordination (IC3) creates a team with the consumer as the leader including people that already known to the family (and others we may choose together) to create one unified plan to reach your goals. Viewpoint partners the consumer to a Care Coordinator who will provide intensive in-home support, community linkages, safety and crisis planning, team building, and a customized plan of care. Additionally, the consumer is partnered with a DBHDD Certified Peer Specialist who serves as a peer support offering advocacy, education, skills building, and empowerment working towards a family vision for a healthy and successful life together. We focus on identifying and developing strengths of the youth, family, and supports to help the consumer remain with you in your own communities. \n\nEmail referral form to email address located at the bottom of the referral form. ','susan.gattman@vphealth.org','Intensive-Custom-Care-Adult (4) viewpoint.docx','https://dl.airtable.com/.attachments/13fcd7cbb6b6cc00440914432d004366/90eb4e7c/Intensive-Custom-Care-Adult4viewpoint.docx','https://www.myviewpointhealth.org/about/programs-a-to-z/referrals/','Vetting In Progress',2,NULL,NULL,NULL,NULL,'1220861047788660,612656932930338','1040192431403484','1151042136691725',1095457030682112,'639387097779678,616815450655447,916621480733882,1213394553614190,593506918155739,767948698346501,1238519411173865,1255107710645949','FT-8000.2500 General Education Advocacy,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1500 Crisis Intervention,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,FT-8000.8000 Special Education Advocacy',NULL),(8,732833359260751,'Georgia Health Partners LLC','GHP','https://dl.airtable.com/.attachments/32555e022e5fd3cff6ade04a02887f9d/d0cac3b9/georgiahealthpartners.jpg',NULL,'Referral form is attached. \n\nServices:\nIntensive Family Intervention (IFI),\nIndividual and Family Counseling,\nCommunity Support and Behavior Assistance,\nDiagnostic assessment,\nMedication administration,\nPsychosocial rehabilitation support,\nCase management,\nTrauma assessment,\nCore Services,\nLife Skills,\nRelaxation therapy,\nAddictive disease support services,\nBehavioral and Mental Health Assessments,\nPhysician and Nursing Assessments & Care,\n24 hour Crisis Intervention','vhills@gahealthpartners.com','GHP_Referral_Form(Savannah).doc.docx','https://dl.airtable.com/.attachments/24b8aa29271a53840e8a870f37036d7b/5c4ba4b6/GHP_Referral_FormSavannah.doc.docx','http://gahealthpartners.com/','Vetted',1,NULL,NULL,NULL,NULL,'1159485741041314,998543685222169,930229276349928,978060880101438,1303309890484687,1064866275306742','1005138863537264','1052979040721473',818219667663604,'639387097779678,789421862693567,616815450655447,639184920602996,608172149903977,944681815739354,1118923838832231,748116754740747,856368601852487,593506918155739,1259904023714336,1297919866260','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RP-1400.8000-070 Anger Management,RP-1500 Crisis Intervention,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,RD-1500 Cognitive Behavioral Therapy,PH-2400.1300 Case/Care Management Referrals,RP-Mental Health Assessment and Treatment,RP-5000.1400 Central Intake/Assessment for Mental Health Services',NULL),(9,778143656133368,'LGBT National Youth Talkline',NULL,NULL,NULL,'The Lesbian, Gay, Bisexual and Transgender (LGBT) National Help Center, founded in 1996, is a non-profit, tax-exempt organization that provides vital peer-support, community connections and resource information to people with questions regarding sexual orientation and/or gender identity. Utilizing a diverse group of LGBT volunteers, we operate three national hotlines, the LGBT National Hotline, the LGBT National Youth Talkline, and the LGBT National Senior Hotline as well as private, volunteer one-to-one online chat, that helps both youth and adults with coming-out issues, safer-sex information, school bullying, family concerns, relationship problems and a lot more.  They run weekly moderated chat rooms for LGBT youth and teens to find support, acceptance and community.  They also maintain the largest collection of resources for the LGBT community in the United States, with 15,000 local resources for cities and towns across the country.The LGBT National Youth Talkline is the oldest and most comprehensive national organization of its type and scope in the United States, providing this critically needed service regardless of age or geographic location. ',NULL,NULL,NULL,'https://www.glbthotline.org/about.html',NULL,4,NULL,NULL,NULL,NULL,'1269288214229663','1219384565292339',NULL,0,NULL,NULL,NULL),(10,763326334047675,'Access Mental Health Agency','AAMH','https://dl.airtable.com/.attachments/be40a2c10e15aae25c0dbeee4fe68dd5/00912634/AAMHlogo.jpg',NULL,'AMHA offers a broad array of outpatient services provided by an experienced, dedicated professional staff of physicians, nurses, licensed therapists, certified addictive disease and behavioral health professionals, social workers, case managers, and mentors. \n\nThe AMHA team of physicians, nurses, licensed therapists, certified addictive disease and behavioral health professionals, social workers, and case managers provide a broad array of healthcare services designed to support your recovery and achievement of personal goals. Because life doesn&rsquo;t happen in an office, we provide most of our services in the community where we all live, work, play, worship, and socialize. We feel this is the most effective way to support real positive change in the lives of the individuals we serve. \n\nAMHA services include:\n\nindividual counseling for youths and adults\ngroup counseling for youths and adults\nfamily counseling for youths and adults\npeer support services, both individual and group, for adults\ngroup training for adults\npsychiatric medicine for youths and adults\nhealth assessments and medication education for youths and adults\ncrisis intervention services for youths and adults\naddictive disease support services for adults\ncomprehensive support services for youths\nrehabilitative services for adults\ncase management for adults \n\nFor all new intakes, Access Mental Health Agency requires a picture ID of youth (if applicable) and parent.  Access Mental Health Agency is always taking new referrals.  They will make sure all intakes are scheduled within a few  days of the referral and will schedule same day if the client is in crisis. All clients who receive services at Access Mental Health Agency must participate in individual counseling.','www.accessmha.com','Access Services Request Form IA-1.pdf','https://dl.airtable.com/.attachments/9c7afd4c8002168c61afba2f1b962b85/017888a9/AccessServicesRequestFormIA-1.pdf','www.accessmha.com','Not vetted',3,NULL,NULL,NULL,NULL,'937551110615945,1202752564499522,617381838606188,1255457630460866,1147764628593389,1315365588561585','637911491907869',NULL,1145634854238262,'791587286497701,1297919866260619,1242514362876733,1213394553614190,616815450655447,789421862693567,771052077935881,968949207637259,639387097779678,916621480733882,767948698346501','PN-8100.0500-180 Drug Use Disorder Support Groups,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RP-1500 Crisis Intervention,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,RD-1500 Cognitive Behavioral Therapy,PH-2400.1300 Case/Care Management Referrals',NULL),(11,857524097390237,'William Immel, LPC',NULL,'https://dl.airtable.com/.attachments/ea823467c4048c80e3b3ee278f19f097/009c8776/Bill-Immelpic.jpg',NULL,'Bill is a graduate of Rutgers University and has a Master&rsquo;