 Georgia in 1985, and has been practicing independently since that time. She continued her education through state and national psychological organizations as well as other approved medical education sponsors and peer supervision.   She has treated OCD for at least 15 years with children and adults.','psyctr1@aol.com ',NULL,NULL,'https://iocdf.org/providers/burnsed-geffen-adelle/','Not vetted',3,NULL,NULL,NULL,NULL,'652722551428232,1279395380631378,1297062497447591,873006420435590','822775222771959','1226239597576850',1250505501130350,'1213394553614190,1193781551435948,639387097779678,616815450655447,953369181551142,916621480733882','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(15,873836259197968,'Trevor Project',NULL,NULL,NULL,'The Trevor Project is the leading national organization providing crisis intervention and suicide prevention services to lesbian, gay, bisexual, transgender, queer & questioning (LGBTQ) young people under 25.',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'1161912885275020','782667995426259',NULL,0,'639184920602996',NULL,NULL),(16,887938623409132,'Hope Counseling Center of Savannah',NULL,'https://dl.airtable.com/.attachments/1947bd70819191de2da86e3e4939c6f2/30893236/hopecounselinglogo.jpg',NULL,'Hope Counseling provides services for youth from Early Childhood to Adolescence.  Services include; Individual Counseling, Social Skills via Group Therapy, Process Groups for Teens, School advocacy, Behavior Modification, Bullying Prevention, Grief and Divorce Recovery, Play Therapy, Animal Assisted Play Therapy.\n\nBased on their therapeutic needs, age, developmental level, personality and preference, your child&rsquo;s therapist will determine a uniquely individual treatment plan and counseling approach to use with your child. Therapeutic approaches may include talk therapy, play therapy, group therapy, or any combination of these.\n\n\nFor Adults, Hope Counseling offers a comprehensive and collaborative approach.  Adults working individually or in couples work are welcomed without judgment to explore their goals and concerns in a supportive and safe environment. Our approach with adults is collaborative and emphasizes hope as a catalyst for change and recovery.  Services include; Individual Counseling, Relationship/Marital Counseling, Grief and Divorce Recovery, Parenting/Co-parenting, Training & Workshops\n\nFor Families, Hope Counseling offers practical solutions.\nOur counselors support and assist families facing&#8232; life challenges, emphasizing effective problem solving and conflict resolution as well as improved communication.  Services include; Family Therapy, Grief and Divorce Recovery','ndrea@hopecounseling.center',NULL,NULL,'http://hopecounseling.center/','Not vetted',3,NULL,NULL,NULL,NULL,'1172223083606480','584003418223973,1147034944508724','570937720530982',1045777867810878,'639387097779678,771052077935881,968949207637259,988970636517896,689909481504179,1149777292769951,1160063855866694,1243892237514253,578290825124982,785935366286776,1254253296739887,95336918155','PL-6600.9700 Yoga,PH-6200.8300 Social Skills Training,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-8000.6600 Play Therapy,RP-6400.3300 Infant and Early Childhood Mental Health,RP 1400.0000.650 Parent Counseling,RP-1400-1400.8000-100 Bereavement Counseling,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,FT-8000.2500 General Education Advocacy,FT-8000.8000 Special Education Advocacy',NULL),(17,903011084269923,'Melanie Mills, LPC, CACII,  ATR-BC',NULL,'https://dl.airtable.com/.attachments/ab5e096a370d545ac9f2fd8e468c9bf7/ab1bb599/meleniemillspic.jpg',NULL,'Using a collaborative approach, she works closely with you to provide a positive therapeutic experience. With over 25 years of clinical experience, she provides for many different populations of adults, couples, families and children with the belief that change and healing is possible - no matter the past. She can work with you in a more immediate solution-focused way to address a crisis, or at a deeper level to meet goals for long-term issues. As a Certified Addictions Counselor for nearly 20 years, she emphasizes progress, not perfection, and incorporate a non-judgmental attitude for those affected by substance issues.\n\nShe utilizes an affirming, reality-based approach to counseling based on individual needs using Cognitive Behavioral Therapy, Solution Focused Brief Therapy, 12 Step, or stress management. In addition to talk therapy, She is a Board Certified/Registered Art Therapist and trained in Sandtray Therapy. Visual expression is a powerful tool for concerns difficult to verbalize.\n\nEMDR relieves trauma and anxiety reactions and has been invaluable in my work with military, their families and other survivors. Learn to change your thinking, manage your emotions and accept your best self. ',NULL,NULL,NULL,'https://www.psychologytoday.com/us/therapists/melanie-mills-savannah-ga/95453','Not vetted',3,NULL,NULL,NULL,NULL,'1292926321263093','1223963668955517','987312017916323',661564729925858,'639387097779678,1193781551435948,890080428886480,1175779353594655,636015951022686,616486824376199,1247220421586706,1160063855866694,1243892237514253,1224288192870809,573698134502315,675333962','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling,