vices\nJob Readiness Skills\nTransportation Services\nFoster Care Development\nInternships','epact-inc@hotmail.com',NULL,NULL,'https://www.epact-inc.com/','Not vetted',3,NULL,NULL,NULL,NULL,'860168572591516,1139231702630622,815373718172508','1262607973454058','606446291511615',828048791924989,'639387097779678,1213394553614190','PH-2360.2350 Family Preservation Programs,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,PH-2400.1300 Case/Care Management Referrals',NULL),(27,1063946909176619,'Atlantic Counseling',NULL,'https://dl.airtable.com/.attachments/152e33fb3aae96f0854fbed7a7ef235c/3aa816ea/AtlanticCounselinglogo.jpg',NULL,'Atlantic Counseling offers a variety of counseling and therapy services to meet your needs including; Individual and Family Therapy, PTSD, Coping with Deployment, Grief Counseling, Treatment of Anxiety and Depression, Couples Counseling, Substance Abuse Services, Addiction Services, Victim Counseling, Trauma Focused Brief Counseling.','atlanticcounselingservices@gmail.com',NULL,NULL,'https://www.atlanticcounselingservices.org/',NULL,4,NULL,NULL,NULL,NULL,'814251861537720','901206961205061','975897498556710',0,'639387097779678,1213394553614190,890080428886480,968949207637259,1330329970990630,1164281363890417,1175779353594655,618650255730163,636015951022686,789421862693567,1149777292769951,1247220421','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(28,1094401029893949,'Lookout Mountain Care Management Entity',NULL,'https://dl.airtable.com/.attachments/20ce0088f5ee37ef7a1b8e5afe3fbb82/2aa7a3e3/viewpointlogo.png',NULL,'High Fidelity Wraparound/Intensive Customized Care Coordination (IC3) creates a team with the consumer as the leader including people that already known to the family (and others we may choose together) to create one unified plan to reach your goals. Viewpoint partners the consumer to a Care Coordinator who will provide intensive in-home support, community linkages, safety and crisis planning, team building, and a customized plan of care. Additionally, the consumer is partnered with a DBHDD Certified Peer Specialist who serves as a peer support offering advocacy, education, skills building, and empowerment working towards a family vision for a healthy and successful life together. We focus on identifying and developing strengths of the youth, family, and supports to help the consumer remain with you in your own communities. \n\nEmail referral form to email address located at the bottom of the referral form. ','lmcme@lmcs.org ','Intensive-Custom-Care-Adult (4) viewpoint.docx','https://dl.airtable.com/.attachments/13fcd7cbb6b6cc00440914432d004366/90eb4e7c/Intensive-Custom-Care-Adult4viewpoint.docx','https://www.lmcs.org/resources/','Not vetted',3,NULL,NULL,NULL,NULL,'1220861047788660,612656932930338',NULL,'1151042136691725',0,'639387097779678,616815450655447,916621480733882,1213394553614190,593506918155739,767948698346501,1238519411173865','FT-8000.2500 General Education Advocacy,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1500 Crisis Intervention,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,FT-8000.8000 Special Education Advocacy',NULL),(29,1066063275223463,'Kristin Fahey Counseling & Consulting',NULL,'https://dl.airtable.com/.attachments/3ef0582b8edd615fac3d22e76fd69f55/5e10173b/kristenfaheylogo.png',NULL,'Addiction & Substance Use Disorder, Social Worker - Clinical. ',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'915187481914425','777491857913804','1174565888439620',775625383874928,'639387097779678,1213394553614190','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(30,1066842143635008,'Joye Psychology and Associates',NULL,'https://dl.airtable.com/.attachments/fa6c8eef5a94d62cb61a04501f6a7ecc/df7d0374/joyelogo.jpg',NULL,'We provide comprehensive diagnostic assessments and therapy for children, adolescents, and adults in Chatham County and the surrounding areas. \n\nASSESSMENT SERVICES\nWe offer personalized, comprehensive assessments in the following areas for children and adults: * Gifted and Talented * Kindergarten Readiness * Learning Disability * Academic Achievement/Grade-Level Readiness * College Academic Readiness * Attention-Deficit/Hyperactivity Disorder (ADHD) * Autism Spectrum Disorder and other developmental disorders (as young as 18 months old) * Intellectual Functioning * Mood Disorders * Anxiety Disorders.\n\nFor all grade-level assessments, we conduct differential diagnosis and offer written recommendations about school placement and accommodations as well as ways to work with your child or teen at home to maximize his or her success. For college-level assessments, we include in our reports recommendations aimed at maximizing the student\'s success. As needed, we can also provide IEP/504 Plan support, including attending school meetings.\n\nAssessment Procedure:  Assessments typically consist of an intake appointment, during which we will decide what testing is needed and agree on a price, a testing session, and a feedback session. Depending on your needs, testing can be divided into multiple sessions. \n\nTHERAPY SERVICES\nFor children and families: We offer therapy for issues including (but not limited to): * disruptive behavior disorders * academic problems * ADHD * Autism Spectrum Disorder * anxiety, fears, and phobias * noncompliance * tantrums. We also offer groups for children and their parents, including expressive arts, social skills, and parenting/support groups using a 1-2-3 Magic framework (123magic.com). \n\nSummer Camps: In mid-July, we will offer theme-based social skills camps for rising 1st through 5th graders. Groups will be small (6-8 children), last for one week, and engage children to learn social skills using Legos, magic, comic books, expressive arts, and other fun activities. Space is limited, so please let us know now if you are interested! \n\nSocial Skills Groups: Like our summer camps, social skills groups focus on learning social skills in a fun and engaging context. Currently, we have a Daniel Tiger group for 4-6 year old children, and we plan on continuing to add more ages as grow. Please sign up for our newsletter - we will announce new groups as they are scheduled! \n\nFor adults: We offer treatment for individuals and couples for a range of presenting issues, including: * depression * anxiety * interpersonal/relationship problems * adjustment issues * transition to college * issues related to self-esteem * gender/sexual identity * trauma. We hope to soon offer meditation groups for adults as well. \n\nFor all services: We use primarily evidence-based cognitive behavioral therapy for children and adults, which is problem focused and goal directed. Most issues can be effectively addressed in a short period of time (6 to 12 sessions). Treatment type and duration time will be individualized to meet the needs each patient. &#8203;\n','emorrissey@joyepsyc.com',NULL,NULL,'http://www.joyepsychology.com/','Not vetted',3,NULL,NULL,NULL,NULL,'1313245696952262,1235053669565274','909316241133034','624872025396095',937632561206587,'639387097779678,1160063855866694,1243892237514253,1320420504969618,636015951022686,1175779353594655,1213394553614190,618650255730163,767948698346501','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(31,1108209842099732,'May Institute',NULL,'https://dl.airtable.com/.attachments/6d3ad4576c3ba3328b6e4a2f63eefa4e/9f70b560/Mayinstitutelogo.jpg',NULL,'May Institute is a nonprofit organization that is a national leader in the field of applied behavior analysis, serving individuals with autism spectrum disorder and other developmental disabilities, brain injury and neurobehavioral disorders, and other special needs.\n\nFounded nearly 65 years ago, we provide a wide range of exceptional educational and rehabilitative services across the lifespan.\n\nThe organization is one of the largest and most well-respected providers of services and special education schools for children and adults with autism and other special needs in Massachusetts and in the U.S.\n\nMay Institute has evolved into a national network that serves thousands of individuals and their families annually. With corporate headquarters in Randolph, Mass., the organization operates more than 140 service locations in more than a dozen states across the country.','hthomas1@mayinstitute.org',NULL,NULL,'https://www.mayinstitute.org/','Vetting In Progress',2,NULL,NULL,NULL,NULL,'1045335164002943,1293034277716957,946915336980044,574876568698708','1181452283889795','587796586661919',1325952759579779,'639387097779678,1091081542574390,916621480733882,1213394553614190,767948698346501,1238519411173865,818831669488442,616815450655447,953369181551142,1242514362876733,992847711096148,61865025573','YB-9500.0500 Adolescents,RR-8500.4700 Licen