vice Board charges based on a sliding fee scale in accordance with Georgia\'s Department of Behavioral Health and Developmental Disabilities Policy. The fee scale is based on family income and ability to pay. No one will be denied access to services due to inability to pay. Gateway also accepts Medicaid, WellCare, Amerigroup, and some private insurance. \n\nGateway also does not accept referrals but there is an Open Access held every day, Monday-Friday, from 8:30am to 10:00am. Consumers will need to pre-register by calling 1-866-557-9955. ','delphina.greene@gatewaybhs.org',NULL,NULL,'https://www.gatewaybhs.org/','Not vetted',3,NULL,NULL,NULL,NULL,'1097414935292876,1209000467748869,939058440382897,1263999077757169,1179920850787529','1055462335344100','1046407159111348',946854070779016,'1297919866260619,639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,1160063855866694,846883653369076,618650255730163,890080428886480,1247220421586706,121339455361','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,RD-1500 Cognitive Behavioral Therapy,PH-2400.1300 Case/Care Management Referrals',NULL),(34,1188830597446547,'Georgia PINES','GA PINES',NULL,NULL,'\nGeorgia Parent Infant Network of Educational Services (PINES) serves children in the state of Georgia from birth to age five who have hearing loss and/or vision loss, and their families. We will request a current audiology report and/or vision report as part of the referral process.  Services offered: Language/communication and developmental assessments specific to sensory loss, Audiological testing, Functional vision evaluations, Orientation and mobility evaluations, CVI Range Assessments, Comprehensive Sensory Assessments, Parent/professional Lending Library, Loaner hearing aid bank, Loaner adaptive toy/equipment bank, Regional parent meetings on sensory loss and its implications, Informational and training videos accessible from Georgia PINES website, Center-based full-time toddler classrooms','hevans@doe.k12.ga.us','GA PINES Referral Form.docx','https://dl.airtable.com/.attachments/98fa824cf9447e6c23b3a774875a5267/9d344dae/GAPINESReferralForm.docx','http://gapines.us/',NULL,4,NULL,NULL,NULL,NULL,'1234204422482292','801676036671140','782697671288291',850930066035479,'818831669488442',NULL,NULL),(35,1207585948488118,'Mathew Reardon Center for Autism',NULL,NULL,NULL,'The Matthew Reardon Center for Autism is the only organization in southeast Georgia that operates an accredited, year-round education program for students with autism and one of only a handful of such programs in the entire state.  While Advance Academy&rsquo;s impact is restricted by size, our Outreach and Advocacy programs reach throughout southeast and coastal Georgia. Through our programs, intakes and consultations, we are like the proverbial pebble thrown in to the pond where the rings keep reaching wider and wider. MRCA provides assistance to children and families dealing with ASD and other developmental disorders in the immediate Coastal Empire and beyond. Over the past 15 years MRCA has directly served literally thousands of individuals, families, educators and professionals through our programs for advocacy, intern placement, intakes, outreach, therapy, education and advanced ABA training. With much appreciation, MRCA receives partial funding through the Georgia Dept. of Behavioral Health and Developmental Disabilities.',NULL,NULL,NULL,'https://matthewreardon.org/',NULL,4,NULL,NULL,NULL,NULL,'1305040619474781,874802625762364,1048134029015061,898813862000522,1254508929386893','811750639699988','607467632753960',0,'944681815739354,639387097779678,992847711096148',NULL,NULL),(36,1209156844866073,'Southeast Second Chance',NULL,'https://dl.airtable.com/.attachments/5a41e4172ddfd88f2015a6d89e8d28bb/11224991/secondchanceimage.jpg',NULL,'Southeast Second Chance, Inc. was formed in 2007 to serve individuals, couples, and families with an array of life problems. The philosophy of the practice is to empower individuals to cope with, and solve, their problems, accentuating their strengths and unique capabilities. Cognitive-behavioral, relapse prevention and solution focused techniques are used to help people move on with their lives as quickly as possible. SESC treats all types of problems including depression, anxiety, substance abuse, major mental health disorders, issues related to development, including divorce, family reunification, aging, and young families with children and adolescents. These services include individual, couples, family (child and adolescent) services, mental health and psychological evaluations.\n\nForensic Services include court ordered evaluations and treatment as well as specialized mental health, parenting, problem sexual behavior, and domestic violence issues. Specialists offer evaluations and comprehensive treatment services to juveniles and adults dealing with problematic sexual behaviors. Services are encouraged for people who are not involved in the legal system. For our staff, ongoing training, ethical and resource development are an integral part of the program. Treatment groups are held weekly in Savannah, Brunswick, and Woodbine.','www.southeastsecondchance.org',NULL,NULL,'http://southeastsecondchance.org/','Not vetted',3,NULL,NULL,NULL,NULL,'959530722783451,738841126603687','1206688914761370,990581489303287','539012621432586,1087793265921318',1275874278517679,'639387097779678,771052077935881,968949207637259,988970636517896,1193781551435948,1149777292769951,1160063855866694,1224288192870809,616486824376199,818831669488442,953369181551142,61681545065','YZ-8200 Sexual Assault Issues,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-800 Sexual Assault Counseling,RP-5000.5000-050 Anxiety Disorder Screening,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,RF-2000 Family Counseling',NULL),(37,1271207565206427,'Recovery Place Inc',NULL,'https://dl.airtable.com/.attachments/9efb5b7ec827bff802e59b052371982b/bd3fba3b/recoveryplacelogo.png',NULL,'Recovery Place was first established in 1984 as a treatment center for Savannah, GA residents to get the care they need for drug abuse, alcoholism, and behavioral health conditions. Recovery Place has since become fully accredited by the Commission on Accreditation of Rehabilitation Facilities (CARF) and has been named a best practices model facility as well.\n\nOur team of qualified clinical and medical professionals provide comprehensive care to help people get the attention and services that they need &ndash; all in our tranquil and comfortable rehabilitation facility. There is a wide range of treatment options for clients to choose from, including outpatient, partial hospitalization, or residential services, depending on your individual situation.\n\nSince 1984, we have helped over 20,000 people achieve recovery and better their lives through the therapy, medical attention, case management support, and additional services that Recovery Place offers. We want to help you get your life back and gain the confidence to succeed. We use a strengths-based approach with a fully licensed and caring staff.\n\nMeet Our Caregivers','jchisholm@recoveryplace.org',NULL,NULL,'https://recoveryplace.org/','Vetting In Progress',2,NULL,NULL,NULL,NULL,'1253153125696748,787496351815691,1318620660326965,843020321321040','891022590186155','572222951228384',1329779272841786,'639387097779678,77105