ac50f44a77688c8a/9b7a03fe/cwilliams.jpg',NULL,'Mental Health Counseling Services at C. Williams and Associates.\nMeet our providers:\nCORI WILLIAMS,  LPC -  She has extensive experience treating individuals with anxiety, depression and attachment issues. She is most passionate about advocating for individuals with developmental disabilities and their families.  She specializes in counseling individuals with developmental disabilities and autism. She strives to help them build their lives to their fullest potential.  She uses mindfulness, art and play within her practice to decrease anxiety in the clients she serves. She is willing to meet outside of the therapy office, in the most comfortable setting for the client.\n\nCHRIS WILLIAMS, LPC - He has experience treating individuals with depression, anxiety, as well as couples counseling. His experience in the mental health field began in 2003 and has worked with a variety of individuals dealing with a wide range of issues. His passion is working with couples dealing with communication difficulties, trust issues, as well as parenting style differences. He focuses on the individual as a whole and use a wide range of modalities such as Cognitive Behavioral Therapy, Person Centered, and Seven Challenges for adolescents. His goal is to meet each client where they are in the treatment process and provide individualized treatment planning to maximize your potential!\n\nNINA KENNEDY, LMFT - She works with individuals, couples and families of all ages. She specializes in depression/anxiety, marital issues, child behavioral issues, LGBTQ, and substance abuse. She is highly proficient in working with both voluntary and involuntary assessment and treatment. She has recently been voted 2018 Savannah\'s Best of the Best Therapist/Psychiatrist by Savannah Morning News. She believes people come to therapy because they want help. They want something to be different. She feels it is her place to help someone identify that and find ways they feel will get them where they want to be. \n\nJENN BOYD, LPC -  She has experience working with youth, adults, and families on a variety of different issues including suicidality, self harm, anxiety, depression, difficulty regulating emotions, and trauma. She utilizes a person-centered style of therapy, based on each individuals\' needs and have been trained in Dialectical Behavioral Therapy as well as Trauma Focused Cognitive Behavioral Therapy.  She strives to provide a safe environment to explore personal issues while also teaching skills to help manage overwhelming emotions and seek solutions. She enjoys incorporating mindfulness and other techniques into therapy to help implement these strategies, ultimately helping people learn the skills to become in control of their feelings and behaviors.  When one feels more in control of their emotions and the ability to tolerate distress, it can be easier to deal with the inevitable challenges we face.','www.cwilliamsandassociates.com','Organizational Referral Intake Packet cwilliams.docx','https://dl.airtable.com/.attachments/64d310fdd8619f41a52428d39b3e28ec/1ec7d9a7/OrganizationalReferralIntakePacketcwilliams.docx','https://cwilliamsandassociates.com/','Not vetted',3,NULL,NULL,NULL,NULL,'1184167324811540,1291526243548418,819830790386455,1315365588561585','1122969038292767','1276050815212765',1246039041277873,'639387097779678,789421862693567,771052077935881,968949207637259,1330329970990630,1193781551435948,1160063855866694,616815450655447,797229853250820,1213394553614190,1118923838832231,8563686018','YZ-8420 Suicide Issues,YZ-4530 LGBTQ Issues,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5150.5000-800 Suicide Prevention Programs,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-5000.5000-050 Anxiety Disorder Screening,RP-1500 Crisis Intervention,RP-1400.8000-825 Suicide Counseling,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(40,1255986585087955,'Savannah-Chatham County Public School System',NULL,NULL,NULL,'Preschool Intervention (PSI) is a program that actively seeks to locate and identify children 3-5 years, who may have developmental delays, and in need of special education and related services. Early identification of developmental delays can help children avoid serious learning problems when they reach elementary school age.','Catherine.cooper@sccpss.com',NULL,NULL,'https://spwww.sccpss.com/aa/si/Pages/default.aspx',NULL,4,NULL,NULL,NULL,NULL,'674469396659327,690845093615500','1041215052114720,608991665111990','1219711251923782,659919178751040',9223372036854775807,'616815450655447,593506918155739',NULL,NULL),(41,1264014271336859,'J C Lewis Primary Health Care Center',NULL,'https://dl.airtable.com/.attachments/e17adc79bce72a5d98c86107b77e166e/4242d20a/JCLlogo.jpg',NULL,'J.C. Lewis Behavioral Health program provides comprehensive behavioral health services  to  consumers of J C Lewis medical or dental  program.',NULL,NULL,NULL,'http://www.jclewishealth.org/services/behavioral-health-care-services/','Not vetted',3,NULL,NULL,NULL,NULL,'759040395154305,954329153684849,1189086167338399,1136801539838195','1199373240119152','1342101724204403',656232573636886,'1213394553614190,639387097779678,767948698346501','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,PH-2400.1300 Case/Care Management Referrals',NULL),(42,1281504324068114,'Georgia Sensory Assistance Project','GSAP','https://dl.airtable.com/.attachments/43c60ebb7061503d7a35454d933c840a/87864803/GSAP.jpg',NULL,'GSAP provides consultation, training, and resources for educators and families of children and youth with combined vision and hearing loss from birth through 21 years of ages.  They provide additional support during transition from early intervention to school services and transition from school to the community.','cvail@uga.edu','GSAP-student-identification-letter-2018.pdf','https://dl.airtable.com/.attachments/42f04bcae92e340bd25e3e1320f26be3/dd95df16/GSAP-student-identification-letter-2018.pdf','http://gsap.coe.uga.edu/',NULL,4,NULL,NULL,NULL,NULL,'1270840026440820,1161960277039101','873971254717311','927107536964991',927325697776366,'639387097779678,1213394553614190,1022757596728517,1242514362876733,988109519141727,616815450655447,818831669488442',NULL,NULL),(43,1289247967843300,'Katherine Mckenzie, LPC',NULL,'https://dl.airtable.com/.attachments/7dc46619928147e7ba81ff6e1e9c09f0/41e356e1/katherinemckenzielogo.png',NULL,'Katherine D. McKenzie LPC is a female counselor in Savannah, GA.',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'839236359897533','1253884668561909','873298214845556',1122887222515225,'639387097779678,1193781551435948,1213394553614190','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(44,1308660189554945,'Georgia Crisis and Access Line (GCAL)','GCAL',NULL,NULL,'GCAL is available 24 hours a day, 7 days a week and 365 days a year to help you or someone you care for in a crisis. GCAL professionals will: provide telephonic crisis intervention services, dispatch mobile crisis teams, assist individuals in finding an open crisis or detox bed across the State, link individuals with urgent appointment services\nIn addition, GCAL will help you to access a State Funded provider in your area in a non-emergency as well.',NULL,NULL,NULL,'https://www.valueoptions.com/referralconnect/doLogin.do?j_username=gacm&j_password=gacm',NULL,4,NULL,NULL,NULL,NULL,'783922882600786','949606705786543',NULL,0,'639387097779678,1095053765654102','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RX-8250.1700 Drug Use Disorder Education/Prevention,RX-0400.2500 General Assessment for Substance Use Disorders,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RP-1400-1400.8000-100 Bereavement Counseling,RP-1400.8000-070 Anger Management,RP-1500.1400-200 Domestic Violence Hotlines,RP-1500.1400-750 Sexual Assault Hotlines,RP-5000.1400 Central Intake/Assessment for Mental Health Services,RP-1500 Crisis Intervention,RP-1400.8000-825 Suicide Counseling,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,PH-2400.1300 Case/Care Management Referrals',NULL),(45,1264690864853116,'Ashley Richbourg, LCSW',NULL,'https://dl.airtable.com/.attachments/1aba13a4f113afe7a384c720c271386d/1ee6064f/ashleyrichbourg.jpg',NULL,'Ashley Richbourg , LCSW is a licensed clinical social worker with a Masters of Social Work from the University of North Carolina at Chapel Hill. Ashley brings years of experience as an in-home individual & family therapist working with couples to strengthen and improve relationship skills. She now focuses her experience on providing solution based therapy to a range of clients with many different issues. She specializes in working with individuals and couples who are determined to focus on their strengths and build towards a better future.',NULL,NULL,NULL,'https://www.georgiaoutreach.com/therapists-3/ashley-richbourg-lcsw/','Not vetted',3,NULL,NULL,NULL,NULL,'577524491603345,794781737822351','1000710924307359','574794009437158',848899122442716,'639387097779678,1213394553614190,953369181551142,616815450655447,916621480733882','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(46,1306784019365289,'Judy Saucerman, LCSW',NULL,'https://dl.airtable.com/.attachments/f13c9a2f3d6ad2ebfbc019334e5e1417/196d5f89/judysaucerman.jpg',NULL,'Judy Saucerman, LCSW is a licensed clinical social worker with over 20 years of experience doing therapy in outpatient, inpatient, substance abuse, forensic, agency and military clinics.  Wanting to know you and what you really need drives her interest in providing your therapy. She will guide you in exploring the real you, and helping you make sense of your thinking and decisions helps you arrive at new clarity and peace. Judy&rsquo;s years of experience and training will be utilized to help you learn the coping skills and tools to deal with what&rsquo;s bothering you.\n\nOur office offers a wide array of services to suit your current need. Each provider brings their own unique way to providing care backed with years of training and experience.  Regardless of their professional back ground, each is committed to providing you with the care and treatment you need to get through your situation. \n\nHere are some of our general services offered in through our office. Please take some time to learn more about what we offer so that you can identify what best suits you when you contact us. If you do not see what you are looking for, or if you need some guidance please do not hesitate to contact our office.\n\nServices:\n&bull; Psychiatry Services\n&bull; Counseling and Pyschotherapy Services\n&bull; Military members and Family Services\n&bull; Anger Management Class\n&bull;  Professional Supervision ',NULL,NULL,NULL,'https://www.georgiaoutreach.com/','Not vetted',3,NULL,NULL,NULL,NULL,'1211401859505005','946390674647798','766114163250573',1021481825385959,'639387097779678,1193781551435948,1213394553614190,1164281363890417','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(47,1325705296267184,'Erin Adams, MAMFT, LPC, NCC',NULL,'https://dl.airtable.com/.attachments/c4a28eec110182a9aa5a8941c1fb3139/3c38ea22/erinadams.jpg',NULL,'Erin Adams is a graduate of Georgia Southern University and Psychological Studies Institute (PSI). PSI specializes in training Christian counselors. She holds a Masters in Marriage and Family Therapy. She is a Licensed Professional Counselor and a National Certified Counselor. A longtime member of the America Association of Christian Counselors, Erin has over 8 years&rsquo; experience in Christian counseling, counseling individuals, couples, families and groups. She has worked with the Department of Family and Children Services as well as with several Georgia community service boards offering her experience working with issues such as depression, anxiety, abuse and adjustment issues, bipolar disorder and women&rsquo;s issues.','barnabuscenter1@gmail.com',NULL,NULL,'https://barnabascenter.net/counselors/','Not vetted',3,NULL,NULL,NULL,NULL,'1128500137966321','855260068571176','637879152777206',788710545598112,'639387097779678,953369181551142,1213394553614190,616815450655447,890080428886480,636015951022686,1243892237514253,689909481504179,945978368279481,1193781551435948,578290825124982,122428819287','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(48,1339182713147731,'Trauma Drama Therapy',NULL,'https://dl.airtable.com/.attachments/f19632bbc477363711e6b27a0044815d/cdc8d489/traumadramapic.jpg',NULL,'Has your child experienced a traumatic event such as physical or sexual abuse, the traumatic death of a loved one, or witnessing domestic violence? Such traumas are treatable when using evidence based Trauma Focused-Cognitive Behavioral Therapy. Research indicates that TF-CBT is the most successful treatment for traumatized children.\nI am a Certified Trauma Focused-Cognitive Behavioral Therapist. I can help your child address thoughts, feelings and behaviors that have been negatively affecting him or her. By adhering to this evidence based process, together we (parent/caretaker, child and therapist) can address trauma reminders and inaccurate or unhelpful beliefs.\nIf your child has experienced a traumatic event and you would like more information, please don\'t hesitate to contact me, Lorrie Rumpel, at Trauma Drama Therapy.','lrumpel@traumadrama.us',NULL,NULL,'https://www.psychologytoday.com/us/therapists/trauma-drama-therapy-savannah-ga/154733','Vetting In Progress',2,NULL,NULL,NULL,NULL,'1178329697630860','1225987825999811','680724149779279',588559626701281,'1297919866260619,639387097779678,789421862693567,771052077935881,988970636517896,675333962875133,944379166032449,818831669488442,953369181551142,616815450655447,1213394553614190,7679486983465','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling,RD-1500 Cognitive Behavioral Therapy',NULL),(49,1307966398736984,'Babies Can\'t Wait (Chatham County Health Department)','BCW','https://dl.airtable.com/.attachments/4ba3255b038197fee6a3a2e70cebad5e/9bcd7cf3/BCWlogo.jpg',NULL,'Babies Can&rsquo;t Wait (BCW) is Georgia&rsquo;s Early Intervention program serving children with significant developmental delays, or children who may be at risk for delays due to a diagnosed medical condition. The program provides services to children from birth to age three and their families.  All referrals to Babies Can&rsquo;t Wait come through Children First, the single point of entry for all Children&rsquo;s Special Services programs.  Babies Can&rsquo;t Wait is a voluntary program and there are no financial eligibility requirements. The staff of BCW provides free evaluations to determine eligibility. Service coordination is also a free service. Other services through the BCW program include physical therapy, occupational therapy, speech therapy, assistive technology devices, audiology, family training and counseling, nutrition services, psychological services, special instruction and vision services. BCW staff includes a behavior specialist, family therapist, licensed registered nurse, licensed practical nurse, licensed dietitian, orientation/mobility specialist, psychologist, and social worker.','kimberly.mcaliley@dph.ga.gov','Children-1st-Screening-Referral-Form.pdf','https://dl.airtable.com/.attachments/0c0d6452d142a3ed4267a72fc024038f/e1b2f37c/Children-1st-Screening-Referral-Form.pdf','https://www.gachd.org/programs-services/child-health-services/babies_cant_wait/','Not vetted',3,NULL,NULL,NULL,NULL,'636742935787303','869067010350403','1165033321326298',594678693814717,'992847711096148,598294217954047,1242514362876733,1022757596728517,988109519141727,818831669488442',NULL,NULL),(50,1331648383899730,'Johnny\'s Bridges to Hope Support Services',NULL,NULL,NULL,'Johnny\'s Bridges to Hope provides families guidance and resources for families dealing with a mentally ill family member by providing one on one family counseling and monthly family support groups. One on One Counseling provides counseling in a convenient location, maximizes the family support system through community resources, addresses common questions and concerns, and provides tips on how to effectively deal with a mentally ill family member. Johnny\'s Bridges to Hope also offers monthly family support, led by a Licensed Master Social Worker, allowing families to feel less alone and to share their feelings. \n\nThe main objectives of the Johnny\'s Bridges to Hope are:\n* Improve the quality of life for the patient and family member by helping families understand the illness,\n* Empower families with necessary resources to be more helpful to the patient,\n* Teach skills to better address their family member\'s challenging and disruptive behavior, and\n* Teach caregivers to reduce stress and to take care of themselves while improving parent coping skills and support.','mitchellte@sjchs.org','JBTH Referral Form.pdf','https://dl.airtable.com/.attachments/2107013fff92cb92de9cd580fdaa96bc/5f519521/JBTHReferralForm.pdf','https://www.sjchs.org/in-the-community/johnnys-bridges-to-hope','Vetted',1,NULL,NULL,NULL,NULL,'906783639619941','1292344104504526','776300774492735',1155275351527917,'639387097779678,915499537874128,616815450655447,953369181551142,1022757596728517,1213394553614190,1118923838832231,856368601852487,748116754740747,1184865322025394',NULL,NULL);
