INSERT INTO `pages` VALUES (1,'Home','This is Home page','<p><img style=\"width: 211px;\" src=\"data:image/jpeg;base64,\" data-filename=\"image006.jpg\"></p><p style=\"text-align: center; \">This website is made possible through a grant from the Department of Behavioral Health Office of Children Youth and Families</p><p><br></p>','','0000-00-00 00:00:00','2019-04-18 04:21:07',NULL),(2,'About','Welcome to the Chatham County Children and Adolescent Behavioral Health Services Directory!','<p style=\"text-align: left;\">This website is made possible through a grant from the Department of Behavioral Health Office of Children Youth and Families.&nbsp; It is designed to provide a comprehensive, up to date directory of mental health resources for youth ages 0-17 years.&nbsp; We accept licensed behavioral health providers who offer services to children and youth in Chatham County.</p><p style=\"text-align: left;\">Please contact Patricia Merritt at <a href=\"patriciamerritt@chlink.org\">patriciamerritt@chlink.org</a>&nbsp;if you are interested in a listing on this site and would like information on our Inclusion and Exclusion Policy.</p><p style=\"text-align: left;\">&nbsp;</p>','','0000-00-00 00:00:00','2019-06-17 19:05:32',NULL),(3,'Feedback','This is Feedback page','<script src=\"https://static.airtable.com/js/embed/embed_snippet_v1.js\"></script><iframe class=\"airtable-embed airtable-dynamic-height\" src=\"https://airtable.com/embed/shrGardkjNsxKA6sO?backgroundColor=teal\" frameborder=\"0\" onmousewheel=\"\" width=\"100%\" height=\"1431\" style=\"background: transparent; border: 1px solid #ccc;\"></iframe>','','0000-00-00 00:00:00','0000-00-00 00:00:00',NULL),(4,'Google Analytics','This is Google Analytics Page','UA-141306707-1','',NULL,'2019-06-07 16:05:45',NULL);
