INSERT INTO `services` VALUES (1,574876568698708,'May Institute Autism Services',NULL,1108209842099732,'Autism is a developmental disorder that affects communication and behavior, and includes symptoms that impair the individual\'s ability to function properly in school, work and other areas of life. Although autism can be diagnosed at any age, it is said to be a \"developmental disorder\" because symptoms generally appear in the first two years of life. Autism is also known as a \"spectrum\" disorder because there is wide variation in the type and severity of symptoms people experience. People with ASD have difficulty with social communication and interaction (e.g. lack of eye contact, voice tones that sound sing-song or robotic, facial expressions or gestures that don\'t match what is being said), restricted interests (e.g., intense interest in numbers, details, facts), restrictive/repetitive behavior (e.g., repeating words or phrases, getting upset at changes in routine or sensory input such as light or noise). People with ASD may also experience sleep problems or irritability, but also have many strengths including the ability to learn things in detail and remember information for long periods of time; being strong visual and auditory learners; and excelling in math, science, music or art. But although ASD can be a lifelong disorder and while children who have ASD have difficulty in talking, playing with other children, and relating to others, including their own family, treatment and services can improve their symptoms and ability to function.','587796586661919','https://www.mayinstitute.org/',NULL,'Not vetted','841542262835583,1281785919928080,572201425996280',NULL,NULL,NULL,NULL,NULL,'1181452283889795',NULL,'1325952759579779','639387097779678,1091081542574390,916621480733882,1213394553614190,767948698346501,1238519411173865','844347245811542','3/20/2019 13:26:34','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(2,577524491603345,'A. Richbourg Mental Health Counseling',NULL,1264690864853116,'Programs that provide diagnostic and treatment services for individuals whose psychiatric problems or other emotional difficulties are not severe enough to require 24-hour care but who can benefit from regular consultation and therapy with a mental health professional.','574794009437158','http://www.georgiaoutreach.com/personnel/ashley-richbourg-lcsw/',NULL,'Not vetted','1097885029940814,1092041112040756,1310796733159033,859893932453608,1340989608448798,666142468264925,870511376760949,958354828684061,903871677224270,607877021725861,758978070756466,13365113387',NULL,NULL,NULL,NULL,NULL,'1000710924307359',NULL,'848899122442716','639387097779678,1213394553614190,953369181551142,616815450655447,916621480733882','772724587330531',NULL,'RF-3300 Individual Counseling,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(3,612656932930338,'Viewpoint Mental Health Support Services',NULL,1094401029893949,'An occupational title for individuals with \"lived experience\" who have been trained and certified to work with individuals who have struggles pertaining to mental health, psychological trauma or substance use. Peer support specialists can work with individuals as they develop and implement a personal recovery plan, which can also serve as a contract for engagement. Tasks may include assisting their peers in articulating their goals for recovery, learning and practicing new skills, helping them monitor their progress, supporting them in their treatment, modeling effective coping techniques and self help strategies based on their own recovery experience, and supporting them in advocating for themselves to obtain effective services. Peer specialists may work in a variety of different settings. Some may work alongside mental health providers in clinical settings such as hospitals and crisis centers. Others may work in independent, peer-run organizations. Peer specialists may also work on support teams in housing agencies or employment organizations, or may work on case management.','1151042136691725','https://www.myviewpointhealth.org/about/programs-a-to-z/','susan.gattman@vphealth.org','Vetting In Progress','800253048423056,593184168444374,1213375325663989,859893932453608,990045981720778,1326970718048364,1346652783856247,910918936515294,1163827838578305,776516691643464',NULL,NULL,NULL,NULL,NULL,'1040192431403484,652928657893034',NULL,'1095457030682112','639387097779678,915499537874128,616815450655447,953369181551142,1213394553614190,1118923838832231,856368601852487,748116754740747,639184920602996,1259904023714336,944681815739354,125510771064','967425497055240',NULL,'YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(4,582785583063538,'Georgia Outreach Mental Health Support Services',NULL,599571630068226,'An occupational title for individuals with \"lived experience\" who have been trained and certified to work with individuals who have struggles pertaining to mental health, psychological trauma or substance use. Peer support specialists can work with individuals as they develop and implement a personal recovery plan, which can also serve as a contract for engagement. Tasks may include assisting their peers in articulating their goals for recovery, learning and practicing new skills, helping them monitor their progress, supporting them in their treatment, modeling effective coping techniques and self help strategies based on their own recovery experience, and supporting them in advocating for themselves to obtain effective services. Peer specialists may work in a variety of different settings. Some may work alongside mental health providers in clinical settings such as hospitals and crisis centers. Others may work in independent, peer-run organizations. Peer specialists may also work on support teams in housing agencies or employment organizations, or may work on case management.','982008775481883','https://www.georgiaoutreach.com/',NULL,'Not vetted','593184168444374,910918936515294,1163827838578305',NULL,NULL,NULL,NULL,NULL,'1223764135647595',NULL,NULL,'1213394553614190,593506918155739,639387097779678,1095053765654102,767948698346501,608172149903977,755379262262385',NULL,NULL,'RF-2000 Family Counseling,RD-1500 Cognitive Behavioral Therapy,RF-3300 Individual Counseling,YB-9500.0500 Adolescents,PH-6100.6800 Parenting Skills Classes,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400-1400.8000-100 Bereavement Counseling,RP-5000.5000-050 Anxiety Disorder Screening,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(5,644905287026058,'Clubhouse Mental Health Counseling',NULL,1112271443337891,'Programs that provide diagnostic and treatment services for individuals whose psychiatric problems or other emotional difficulties are not severe enough to require 24-hour care but who can benefit from regular consultation and therapy with a mental health professional.','754649737705617','www.gatewaybhs.org',NULL,'Not vetted','877056620750945,871176715283142,932804893629052,1226513774993977,1095592483926313,609551942870571,876024528359729,758978070756466,1336511338714495',NULL,NULL,NULL,NULL,NULL,'854685172508860','111498678348261