 Individual Counseling',NULL),(7,604312751782605,'YTA Mental Health Psychiatric Services',NULL,600407365797872,'Programs that are staffed by physicians who specialize in the prevention, diagnosis and treatment of mental, emotional and behavior disorders. Psychiatrists have specialized training, knowledge and skills which enable them to explore the biologic, psychological and social components of illnesses; and are licensed to prescribe medication, conduct physical examinations, order and interpret laboratory tests and EEGs and order brain imaging studies such as CT, CAT, MRI and PET scans as well as evaluate and treat psychological and interpersonal problems and provide continuing psychiatric care. May include medication management as well. ','1226130516229368',NULL,NULL,'Vetted','870618126693777,958199564483090,1063427259643927,958354828684061,1193129020060220,1253165932307636,1276346987127390',NULL,NULL,NULL,NULL,NULL,'1155064651413505,922278812748597',NULL,'1143267406656032','639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,916621480733882,1213394553614190,767948698346501,1114719670054079,647561061799814,1255107710645949','1206396650819789','3/20/2019 14:05:30','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(8,636742935787303,'Babies Can\'t Wait Early Intervention Services','BCW',1307966398736984,'Babies Can’t Wait (BCW) is Georgia’s Early Intervention program serving children with significant developmental delays, or children who may be at risk for delays due to a diagnosed medical condition. The program provides services to children from birth to age three and their families. Babies Can’t Wai