 Referrals',NULL),(28,843020321321040,'Recovery Place Substance Use Assessment',NULL,1271207565206427,'Programs that conduct an evaluation to determine whether an individual has a substance use disorder based on a pathological set of behaviors related to use of that substance as well as the nature and extent of the problem. Diagnostic criteria include inability to control or limit the amount taken or the frequency; intense cravings; continuing use despite problems with work, school or family/social obligations or interpersonal problems; risky use, e.g., diving a car or operating machinery while under the influence; or evidence of pharmacological indicators (tolerance and withdrawal symptoms), the adjustment the body makes as it attempts to adapt to the continued and frequent use of a substance.','572222951228384','https://recoveryplace.org/',NULL,'Not vetted','1092041112040756,1248610812578442',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1213394553614190,639387097779678,767948698346501,1238519411173865','1282583230320152',NULL,'YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RX-0400.2500 General Assessment for Substance Use Disorders,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(29,838003184119997,'YTA Mental Health Support Services',NULL,600407365797872,'An occupational title for individuals with \"lived experience\" who have been trained and certified to work with individuals who have struggles pertaining to mental health, psychological trauma or substance use. Peer support specialists can work with individuals as they develop and implement a personal recovery plan, which can also serve as a contract for engagement. Tasks may include assisting their peers in articulating their goals for recovery, learning and practicing new skills, helping them monitor their progress, supporting them in their treatment, modeling effective coping techniques and self help strategies based on their own recovery experience, and supporting them in advocating for themselves to obtain effective services. Peer specialists may work in a variety of different settings. Some may work alongside mental health providers in clinical settings such as hospitals and crisis centers. Others may work in independent, peer-run organizations. Peer specialists may also work on support teams in housing agencies or employment organizations, or may work on case management.','1226130516229368',NULL,NULL,'Vetted','593184168444374,1261122541906662,1069987160604560,1161754954940933,645006353579334,786749664576465,1326970718048364,1346652783856247,1340989608448798,1106636601060879,660710488927612,11294744',NULL,NULL,NULL,NULL,NULL,'1155064651413505,922278812748597',NULL,'1143267406656032','639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,916621480733882,1213394553614190,953369181551142,767948698346501,1114719670054079,647561061799814,125510771064','1206396650819789','3/20/2019 14:05:30','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(30,794781737822351,'A. Richbourg Mental Health Psychiatric Services',NULL,1264690864853116,'Programs that are staffed by physicians who specialize in the prevention, diagnosis and treatment of mental, emotional and behavior disorders. Psychiatrists have specialized training, knowledge and skills which enable them to explore the biologic, psychological and social components of illnesses; and are licensed to prescribe medication, conduct physical examinations, order and interpret laboratory tests and EEGs and order brain imaging studies such as CT, CAT, MRI and PET scans as well as evaluate and treat psychological and interpersonal problems and provide continuing psychiatric care. May include medication management as well. ','574794009437158','http://www.georgiaoutreach.com/personnel/ashley-richbourg-lcsw/',NULL,'Not vetted','1092041112040756,870618126693777,958199564483090,1063427259643927,666142468264925,958354828684061,1193129020060220,1253165932307636,1276346987127390',NULL,NULL,NULL,NULL,NULL,'1000710924307359',NULL,'848899122442716','639387097779678,1213394553614190,953369181551142,616815450655447,916621480733882','772724587330531',NULL,'RF-3300 Individual Counseling,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-6400.8000-660.64 Psychiatric Medication Monitoring,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(31,819830790386455,'C. Williams & Assoc. Autism Services',NULL,1241524558231705,'A developmental disorder that affects communication and behavior, and includes symptoms that impair the individual\'s ability to function properly in school, work and other areas of life. Although autism can be diagnosed at any age, it is said to be a \"developmental disorder\" because symptoms generally appear in the first two years of life. Autism is also known as a \"spectrum\" disorder because there is wide variation in the type and severity of symptoms people experience. People with ASD have difficulty with social communication and interaction (e.g. lack of eye contact, voice tones that sound sing-song or robotic, facial expressions or gestures that don\'t match what is being said), restricted interests (e.g., intense interest in numbers, details, facts), restrictive/repetitive behavior (e.g., repeating words or phrases, getting upset at changes in routine or sensory input such as light or noise). People with ASD may also experience sleep problems or irritability, but also have many strengths including the ability to learn things in detail and remember information for long periods of time; being strong visual and auditory learners; and excelling in math, science, music or art. But although ASD can be a lifelong disorder and while children who have ASD have difficulty in talking, playing with other children, and relating to others, including their own family, treatment and services can improve their symptoms and ability to function.','1276050815212765','www.cwilliamsandassociates.com',NULL,'Not vetted','948640260098758,1258328669902758,841542262835583,572201425996280',NULL,NULL,NULL,NULL,NULL,'1122969038292767',NULL,'1246039041277873','639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,1330329970990630,689909481504179,1193781551435948,1160063855866694,797229853250820,616815450655447,121339455361','772724587330531','3/6/2019 16:01:45','RF-2000 Family Counseling,RM-6500.1500 Community Mental Health Agencies,RP-Mental Health Assessment and Treatment,RP-1400.2500 General Counseling Services,RP-5000.5000-050 Anxiety Disorder Screening,RP-5000.5000-260 General Mental Health Screening,RR-5150.5000-800 Suicide Prevention Programs,YJ-0500.0500 At Risk Youth,YZ-4530 LGBTQ Issues,YZ-8420 Suicide Issues,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(32,814251861537720,'Atlantic Mental Health Counseling',NULL,1063946909176619,'Programs that provide diagnostic and treatment services for individuals whose psychiatric problems or other emotional difficulties are not severe enough to require 24-hour care but who can benefit from regular consultation and therapy with a mental health professional.','975897498556710','https://www.atlanticcounselingservices.org/'