98813862000522,'MRCA Early Learning Academy',NULL,1207585948488118,'Early Learning Academy is a place for every child to learn their world creatively through intentional play, meaningful interactions, and inquisitive exploration. The goal is to incorporate all children in safe, creative, special classrooms where learning becomes a fun daily experience. The program is designed to foster all educational and emotional developmental areas for toddlers (18 months) to pre-kindergarten (48-60 months).','607467632753960','https://matthewreardon.org/ela/',NULL,NULL,'1258328669902758,1226513774993977,873091224397599,969427174556833',NULL,NULL,NULL,NULL,NULL,'811750639699988',NULL,NULL,'675333962875133,639387097779678,944681815739354,818831669488442','1242207168971364',NULL,NULL,NULL),(40,922605061202834,'M. Graham & Assoc. Mental Health Crisis Management',NULL,888435226473868,'Programs that provide immediate assistance for people who are in acute emotional distress; who are or perceive themselves to be in life-threatening situations; who are a danger to themselves or to others; or who are hysterical, frightened or otherwise unable to cope with a problem that requires immediate action. The objective of crisis intervention is to defuse the critical nature of the situation, ensure the person\'s safety, and return the individual to a state of equilibrium in which he or she is capable of identifying and seeking solutions to the problem.','1197180011238880','www.mgacommunityservices.com',NULL,'Vetted','793274560277759,1259576995540885,958354828684061,1231209990652272',NULL,NULL,NULL,NULL,NULL,'615255280057117,782753254786542',NULL,'882026281098116','639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,988970636517896,1193781551435948,618650255730163,915499537874128,616815450655447,953369181551142,1213394553614','1276442726248600,942677525764460','3/20/2019 12:09:27','YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-850