lescent/Youth Counseling,PH-2400.1300 Case/Care Management Referrals',NULL),(54,965389027787296,'Suicide Prevention Lifeline',NULL,896081192730221,'The National Suicide Prevention Lifeline is a United States-based suicide prevention network of 161 crisis centers that provides a 24/7, toll-free hotline available to anyone in suicidal crisis or emotional distress.',NULL,NULL,NULL,NULL,'854998659962292,654895539647560,1259576995540885,1231209990652272',NULL,NULL,NULL,NULL,NULL,'1082867932424752',NULL,NULL,'639387097779678,1095053765654102,767948698346501',NULL,NULL,'YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1500 Crisis Intervention,RP-1400.8000-825 Suicide Counseling,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(55,988348874108459,'Q & R Autism Services',NULL,1258030347645238,'A developmental disorder that affects communication and behavior, and includes symptoms that impair the individual\'s ability to function properly in school, work and other areas of life. Although autism can be diagnosed at any age, it is said to be a \"developmental disorder\" because symptoms generally appear in the first two years of life. Autism is also known as a \"spectrum\" disorder because there is wide variation in the type and severity of symptoms people experience. People with ASD have difficulty with social communication and interaction (e.g. lack of eye contact, voice tones that sound sing-song or robotic, facial expressions or gestures that don\'t match what is being said), restricted interests (e.g., intense interest in numbers, details, facts), restrictive/repetitive behavior (e.g., repeating words or phrases, getting upset at changes in routine or sensory input such as light or noise). People with ASD may also experience sleep problems or irritability, but also have many strengths including the ability to learn things in detail and remember information for long periods of time; being strong visual and auditory learners; and excelling in math, science, music or art. But although ASD can be a lifelong disorder and while children who have ASD have difficulty in talking, playing with other children, and relating to others, including their own family, treatment and services can improve their symptoms and ability to function.','1039507544346750,712300758206965','https://www.facebook.com/qandrconsultationservicesllc/',NULL,'Not vetted','634732976966285,920925622622384,572201425996280,1258328669902758,841542262835583',NULL,NULL,NULL,NULL,NULL,'1280430268019655','1239940828837483','1291078742541334','639387097779678,771052077935881,968949207637259,689909481504179,618650255730163,890080428886480,910547125138880,616815450655447,1213394553614190,821622375158469,1197045062186443,1297919866260','1260350870291637','3/12/2019 15:05:08','RF-2000 Family Counseling,RF-3300 Individual Counseling,RP-1400.2500 General Counseling Services,RP 1400.0000.650 Parent Counseling,YJ-0500.0500 At Risk Youth,YJ-0500.0300 At Risk Families,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RM-6500.1500 Community Mental Health Agencies,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(56,998543685222169,'GHP Mental Health Crisis Management',NULL,732833359260751,'Programs that provide immediate assistance for people who are in acute emotional distress; who are or perceive themselves to be in life-threatening situations; who are a danger to themselves or to others; or who are hysterical, frightened or otherwise unable to cope with a problem that requires immediate action. The objective of crisis intervention is to defuse the critical nature of the situation, ensure the person\'s safety, and return the individual to a state of equilibrium in whi