uding the ability to learn things in detail and remember information for long periods of time; being strong visual and auditory learners; and excelling in math, science, music or art. But although ASD can be a lifelong disorder and while children who have ASD have difficulty in talking, playing with other children, and relating to others, including their own family, treatment and services can improve their symptoms and ability to function.','624872025396095','http://www.joyepsychology.com/',NULL,'Not vetted','666142468264925,572201425996280,1258328669902758,841542262835583',NULL,NULL,NULL,NULL,NULL,'909316241133034',NULL,NULL,'639387097779678,1160063855866694,1243892237514253,1320420504969618,636015951022686,1175779353594655,1213394553614190,618650255730163,767948698346501','629797810057384','3/20/2019 13:19:13','YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(91,1234204422482292,'GA PINES Deaf Vision Loss Early Intervention Services',NULL,1188830597446547,'Early intervention services for children in the state of Georgia from birth to age five who have hearing loss and/or vision loss, and their families.','782697671288291','http://gapines.us/RequestServices.html',NULL,NULL,'873091224397599,1226513774993977,969427174556833',NULL,NULL,NULL,NULL,NULL,'1157110391844305,801676036671140',NULL,NULL,'639387097779678,988109519141727,818831669488442,862922050694311,782511215608456,593506918155739','927199247065559',NULL,NULL,NULL),(92,1209000467748869,'Savannah Counseling Mental Health Assessment',NULL,1188157508639868,'Programs that provide screening, diagnostic and treatment planning services for people who are experiencing acute or chronic psychiatric problems. Included is a continuum of assessment services ranging from a comprehensive psychiatric or psychological evaluation to the administ