Advance Academy works to ensure that students are able to demonstrate the skills they’ve learned at home or in the community in addition to here at school.  It is the only year-round day school in southeast Georgia for children, ages 5-21, diagnosed with ASD.','607467632753960','https://matthewreardon.org/advance-academy/',NULL,NULL,'1258328669902758,1226513774993977,969427174556833',NULL,NULL,NULL,NULL,NULL,'811750639699988',NULL,NULL,'639387097779678,675333962875133,944681815739354','1242207168971364',NULL,NULL,NULL),(106,1260438230692478,'Children\'s Medical Services','CMS',819107786839637,'Children’s Medical Services (CMS) provides medical care coordination for children from birth to age 21 who have disabling conditions or chronic diseases. CMS can provide assistance with long-term specialized care, medical equipment, medications, physical therapy, hospitalization, occupational therapy, nursing services, family education, social services and case coordination.  Eligibility for CMS is based on income, type of medical condition and the age of the child. PeachCare, Medicaid, and Supplemental Security Income (SSI) recipients are accepted. Families with or without insurance are also accepted and may (depending on their income) be required to pay a portion of cost based on a sliding fee scale. Examples of medical conditions covered by CMS include asthma, cerebral palsy, spina bifida, scoliosis, seizures, neurological disorders, immune disorders, hydrocephalus, hearing conditions, Down syndrome, craniofacial disorders, cleft lip and palate, orthopedic disorders, cardiac conditions, chronic lung conditions, vision disorders (other than corrective lenses), diabetes, urinary tract disorders, gastrointestinal disorders and genetic disorders.','1165033321326298','https://www.gachd.org/programs-services/child-health-services/children_first/',NULL,'Not vetted','969427174556833,1226513774993977',NULL,NULL,NULL,NULL,NULL,'869067010350403',NULL,'988720992561368','639387097779678','868506102755418',NULL,NULL,NULL),(107,1292926321263093,'M. Mills Mental Health Counseling',NULL,903011084269923,'Programs that provide diagnostic and treatment services for individuals whose psychiatric problems or other emotional difficulties are not severe enough to require 24-hour care but who can benefit from regular consultation and therapy with a mental health professional.','987312017916323','https://www.psychologytoday.com/us/therapists/melanie-mills-savannah-ga/95453',NULL,'Not vetted','1002100520878338,633127587151884,666142468264925,1173755298386207,785263765755558,1092041112040756,1310796733159033,859893932453608,1340989608448798,958354828684061,607877021725861,7589780707',NULL,NULL,NULL,NULL,NULL,'1223963668955517',NULL,'661564729925858','639387097779678,616815450655447,953369181551142,1213394553614190,1160063855866694,573698134502315,890080428886480,1247220421586706,1224288192870809,1243892237514253,675333962875133,6164868243','919840987033296',NULL,'RP-1400.8000-020.18 Child Sexual Abuse Counseling,RD-1500 Cognitive Behavioral Therapy,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling,RF-3300 Individual Counseling',NULL),(108,1297062497447591,'A. Burnsed-Geffen Autism Services',NULL,830369986737903,'A developmental disorder that affects communication and behavior, and includes symptoms that impair the individual\'s ability to function properly in school, work and other areas of life. Although autism can be diagnosed at any age, it is said to be a \"developmental disorder\" because symptoms generally appear in the first two years of life. Autism is also known as a \"spectrum\" disorder because there is wide variation in the type and severity of symptoms people experience. People with ASD have difficulty with social communication and interaction (e.g. lack of eye contact, voice tones that sound sing-song or robotic, facial expressions or gestures that don\'t match what is being said), restricted interests (e.g., intense interest in numbers, details, facts), restrictive/repetitive behavior (e.g., repeating words or phrases, getting upset at changes in routine or sensory input such as light or noise). People with ASD may also experience sleep problems or irritability, but also have many strengths including the ability to learn things in detail and remember information for long periods of time; being strong visual and auditory learners; and excelling in math, science, music or art. But although ASD can be a lifelong disorder and while children who have ASD have difficulty in talking, playing with other children, and relating to others, including their own family, treatment and services can improve their symptoms and ability to function.','1226239597576850','https://iocdf.org/providers/burnsed-geffen-adelle/',NULL,'Not vetted','572201425996280,1258328669902758,841542262835583',NULL,NULL,NULL,NULL,NULL,'822775222771959',NULL,'1250505501130350','1213394553614190,616815450655447,953369181551142,639387097779678,1193781551435948,916621480733882','1189076306730311',NULL,'RD-1500 Cognitive Behavioral Therapy,YB-9500.0500 Adolescents,RR-8500.4700 Licensed Professional Counselor Referrals,RR-5180 Mental Health Intervention Programs,RR-5150.2500 General Mental Health Information/Education,RP-1400.8000-050 Adolescent/Youth Counseling',NULL),(109,1315365588561585,'Access Mental Health Support Services',NULL,763326334047675,'An occupational title for individuals with \"lived experience\" who have been trained and certified to work with individuals who have struggles pertaining to mental health, psychological trauma or substance use. Peer support specialists can work with individuals as they develop and implement a personal recovery plan, which can also serve as a contract for engagement. Tasks may include assisting their peers in articulating their goals f